<!DOCTYPE html>
<html data-color-mode="light">
<head>
  <title>Render</title>
  
  <meta name="referrer" content="never">
  <style>
    body {
      background: url("/static/bg.gif");
    }
  </style>
  <script src="/static/assets/pdf-54b81a9329bebf31b625.js" type="text/javascript"></script><link rel="stylesheet" href="/static/assets/pdf-54b81a9329bebf31b625.css"/>
  <base target="_top">
</head>
<body
  class="is-embedded"
  data-render-url="//viewscreen.githubusercontent.com"
  data-github-hostname="github.com"
  data-deploy-env="production"
  data-client-timeout-attempts="30"
>
  <div class="render-shell js-render-shell">
    <div class="pdf-container"
       data-file="https://raw.githubusercontent.com/fdnd-agency/vini-mini/7f867cc9dd7dabe4fd7f4edcb92302ceb66c8a95/Vini%20Mini%20Brandbook%20V.pdf"
       data-bcmap-dir="//viewscreen.githubusercontent.com/static/pdf"
       data-pdf-worker-js-path="/static/assets/pdf.worker-54b81a9329bebf31b625.js"
    ></div>

    <nav id="single-page-nav" class="paginate-container" aria-label="Pagination">
      <div class="pagination">
        <a id="page-prev" 
          class="previous_page" 
          rel="prev" 
          aria-label="Previous Page">Previous</a>
        <a id="page-next" 
          class="next_page" 
          rel="next" 
          aria-label="Next Page">Next</a>
      </div>
    </nav>

    <div id="js-click-for-more" class="click-for-more">
      <button class="button">More Pages</button>
      <div class="spinner"><img src="/static/spinner.gif" alt="Loading more pages"/></div>
    </div>
  </div>
</body>
</html>
